guageCode":"tt","languageName":{"simpleText":"Tatar"}},{"languageCode":"cs","languageName":{"simpleText":"Tchèque"}},{"languageCode":"te","languageName":{"simpleText":"Télougou"}},{"languageCode":"th","languageName":{"simpleText":"Thaï"}},{"languageCode":"bo","languageName":{"simpleText":"Tibétain"}},{"languageCode":"ti","languageName":{"simpleText":"Tigrigna"}},{"languageCode":"to","languageName":{"simpleText":"Tongien"}},{"languageCode":"ts","languageName":{"simpleText":"Tsonga"}},{"languageCode":"tn","languageName":{"simpleText":"Tswana"}},{"languageCode":"tum","languageName":{"simpleText":"Tumbuka"}},{"languageCode":"tr","languageName":{"simpleText":"Turc"}},{"languageCode":"tk","languageName":{"simpleText":"Turkmène"}},{"languageCode":"uk","languageName":{"simpleText":"Ukrainien"}},{"languageCode":"ve","languageName":{"simpleText":"Venda"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamien"}},{"languageCode":"war","languageName":{"simpleText":"Waray"}},{"languageCode":"wo","languageName":{"simpleText":"Wolof"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zoulou"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"pKuOAqKpGdw","title":"SQL de A à Z - Intoduction - Presentation du cours #01","lengthSeconds":"265","keywords":["data science","rstudio","python","programmation","big data","formation","machine learning","apprentissage automatique","sql","mysql","data analyst","cours","complet"],"channelId":"UCQFm9OrikP4EhU84bkTOEyQ","isOwnerViewing":false,"shortDescription":"💌 REÇOIS MES EMAILS PRIVÉS POUR PROGRESSER EN SQL : https://go.brightcape.co/newsletter\n\n\nL'objectif de cette vidéo :\n---------------------------\nDans cette vidéo est de vous présenter le programme de cette formation SQL\n\n🔴 COMMENT ME SUIVRE :\n➡️ Abonne-toi à la chaîne YouTube\n➡️ Retrouve-moi sur INSTAGRAM : https://www.instagram.com/data_analyst.fr\n\nQu'est ce que SQL ?\n-------------------------------\nSQL (Structured Query Language) est le langage principal utilisé dans la gestion des données stockées dans un système de gestion de base de données relationnelle (SGBDR) ou du traitement de flux dans un système de gestion de flux de données relationnelles (RDSMS).\n\nEn d'autres termes, SQL est LE LANGAGE utilisé pour interagir avec une base de données.\n\nPourquoi est-il important d’apprendre le SQL?\n-------------------------------------------------------------------------\nSQL est le langage de base de données le plus universel et le plus utilisé : Nous vivons à une époque où les données constituent l’atout le plus précieux et sont au cœur de chaque processus de prise de décision. SQL est l'interface universelle pour l'analyse de données.\n\nSi vous voulez accéder à des bases de données, alors oui, vous devez connaître le langage SQL.\n\nIl n’est pas très difficile d’apprendre le SQL: SQL n’est pas un langage de programmation, c’est un langage de requête. L’objectif principal de la création de SQL était de donner la possibilité aux gens ordinaires d’obtenir des données de la base de données. Il s’agit également d’un langage dont la syntaxe est extrêmement simple . Toute personne peut facilement écrire une requête SQL.\n\n SQL est l’une des compétences les plus recherchées par les employeurs : Toutes les entreprises, quel que soit leur secteur d’activité, reposent toutes sur des données et doivent organiser et comprendre les informations de manière pertinente. \n\nQui devrait apprendre le langage SQL et dans quel but ?\n-----------------------------------------------------------------------------------------\nBusiness Analysts / Product Owners: les Product owners doivent toujours connaître parfaitement le produit qu’ils possèdent, et les données disent la vérité sur la santé d’un produit. C’est bien de connaître SQL et de contrôler ce qui se passe.\n\nAnalystes de données (Data Analysts): le mot ‘données’ figure déjà dans le titre, de même que la popularité des bases de données relationnelles, sachant que SQL est indispensable.\n\nData Scientists: Ceux qui comprennent toujours les données mieux que quiconque sur Terre. Ils doivent absolument maîtriser SQL.\n\nIngénieurs de données (Data Engineer): comme pour les Data Scientist et les Data Analyst, il est indispensable de connaître le langage SQL lorsque vous concevez et maintenez la base de données.\n\nDéveloppeurs Back-End: c'est un peu similaire aux ingénieurs de données en matière de gestion de base de données. Il est difficile de trouver une application backend sans base de données.\n\nDéveloppeurs Frontend: ils ne vont pas écrire beaucoup de SQL, mais avec la montée en puissance de Angular.js, React.js et d’autres frameworks d’application à page unique, il est probable que vous allez interagir plus souvent directement avec les bases de données. Il suffit donc d’apprendre le langage SQL et il sera très utile si vous devenez un jour un développeur à pile complète.\n\nDéveloppeurs d'applications mobiles: si vous êtes un développeur d'applications mobiles, en particulier pour Android, vous avez déjà entendu parler de SQLite. SQLite est une base de données intégrée largement utilisée depuis plus de 20 ans par la majorité des développeurs Android pour les projets où ils ont besoin de stocker les données sur un périphérique, pas sur un serveur. Bien sûr, il est alimenté par SQL.\n\nMarketing / Finance / RH : en tant que business, vous devez être axé sur les données. Connaître SQL vous permettra de d'obtenir les données dont vous avez besoin et vous permettra de mieux analyser votre entreprise. Cela vous donnera plus de perspicacité et vous aidera à avoir plus de valeur.\n\nUne autre bonne nouvelle est que vous n’avez pas besoin de connaître la programmation ni d’être technique pour apprendre le langage SQL.\n\nPourquoi ce cours pour apprendre SQL ?\n----  de gestion de base de données. Il est difficile de trouver une application backend sans base de données.\n\nDéveloppeurs Frontend: ils ne vont pas écrire beaucoup de SQL, mais avec la montée en puissance de Angular.js, React.js et d’autres frameworks d’application à page unique, il est probable que vous allez interagir plus souvent directement avec les bases de données. Il suffit donc d’apprendre le langage SQL et il sera très utile si vous devenez un jour un développeur à pile complète.\n\nDéveloppeurs d'applications mobiles: si vous êtes un développeur d'applications mobiles, en particulier pour Android, vous avez déjà entendu parler de SQLite. SQLite est une base de données intégrée largement utilisée depuis plus de 20 ans par la majorité des développeurs Android pour les projets où ils ont besoin de stocker les données sur un périphérique, pas sur un serveur. Bien sûr, il est alimenté par SQL.\n\nMarketing / Finance / RH : en tant que business, vous devez être axé sur les données. Connaître SQL vous permettra de d'obtenir les données dont vous avez besoin et vous permettra de mieux analyser votre entreprise. Cela vous donnera plus de perspicacité et vous aidera à avoir plus de valeur.\n\nUne autre bonne nouvelle est que vous n’avez pas besoin de connaître la programmation ni d’être technique pour apprendre le langage SQL.\n\nPourquoi ce cours pour apprendre SQL ?\n----------------------------------------------------------------\nCe cours vous apprendra les bases du SQL - le langage le plus utilisé pour la communication avec des bases de données. Nous allons travailler avec des exemples CONCRET utilisant une base de données MySQL - mais les connaissances s’appliquent à d’autres types de SGBD (postgreSQL, HiveSQL, Oracle, SQL Server...)."},"lengthSeconds":"266","ownerProfileUrl":"http://www.youtube.com/@ZackISMAILI","externalChannelId":"UCQFm9OrikP4EhU84bkTOEyQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT", label":"Annuler"},"trackingParams":"CKYEEPBbIhMI_bnn7q6KjQMVhONJBx328w8X"}},"primaryIsCancel":false}},"popupType":"DIALOG"}}]}}]}},"metadataRowContainer":{"metadataRowContainerRenderer":{"collapsedItemCount":0,"trackingParams":"CKMEEM2rARgBIhMI_bnn7q6KjQMVhONJBx328w8X"}},"showMoreText":{"simpleText":"...afficher plus"},"showLessText":{"simpleText":"Moins"},"trackingParams":"CKMEEM2rARgBIhMI_bnn7q6KjQMVhONJBx328w8X","defaultExpanded":false,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"CKMEEM2rARgBIhMI_bnn7q6KjQMVhONJBx328w8X","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CKMEEM2rARgBIhMI_bnn7q6KjQMVhONJBx328w8X","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CKMEEM2rARgBIhMI_bnn7q6KjQMVhONJBx328w8X","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CKMEEM2rARgBIhMI_bnn7q6KjQMVhONJBx328w8X","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"💌 REÇOIS MES EMAILS PRIVÉS POUR PROGRESSER EN SQL : https://go.brightcape.co/newsletter\n\n\nL'objectif de cette vidéo :\n---------------------------\nDans cette vidéo est de vous présenter le programme de cette formation SQL\n\n🔴 COMMENT ME SUIVRE :\n➡️ Abonne-toi à la chaîne YouTube\n➡️ Retrouve-moi sur INSTAGRAM :   / data_analyst.fr  \n\nQu'est ce que SQL ?\n-------------------------------\nSQL (Structured Query Language) est le langage principal utilisé dans la gestion des données stockées dans un système de gestion de base de données relationnelle (SGBDR) ou du traitement de flux dans un système de gestion de flux de données relationnelles (RDSMS).\n\nEn d'autres termes, SQL est LE LANGAGE utilisé pour interagir avec une base de données.\n\nPourquoi est-il important d’apprendre le SQL?\n-------------------------------------------------------------------------\nSQL est le langage de base de données le plus universel et le plus utilisé : Nous vivons à une époque où les données constituent l’atout le plus précieux et sont au cœur de chaque processus de prise de décision. SQL est l'interface universelle pour l'analyse de données.\n\nSi vous voulez accéder à des bases de données, alors oui, vous devez connaître le langage SQL.\n\nIl n’est pas très difficile d’apprendre le SQL: SQL n’est pas un langage de programmation, c’est un langage de requête. L’objectif principal de la création de SQL était de donner la possibilité aux gens ordinaires d’obtenir des données de la base de données. Il s’agit également d’un langage dont la syntaxe est extrêmement simple . Toute personne peut facilement écrire une requête SQL.\n\n SQL est l’une des compétences les plus recherchées par les employeurs : Toutes les entreprises, quel que soit leur secteur d’activité, reposent toutes sur des données et doivent organiser et comprendre les informations de manière pertinente. \n\nQui devrait apprendre le langage SQL et dans quel but ?\n-----------------------------------------------------------------------------------------\nBusiness Analysts / Product Owners: les Product owners doivent toujours connaître parfaitement le produit qu’ils possèdent, et les données disent la vérité sur la santé d’un produit. C’est bien de connaître SQL et de contrôler ce qui se passe.\n\nAnalystes de données (Data Analysts): le mot ‘données’ figure déjà dans le titre, de même que la popularité des bases de données relationnelles, sachant que SQL est indispensable.\n\nData Scientists: Ceux qui comprennent toujours les données mieux que quiconque sur Terre. Ils doivent absolument maîtriser SQL.\n\nIngénieurs de données (Data Engineer): comme pour les Data Scientist et les Data Analyst, il est indispensable de connaître le langage SQL lorsque vous concevez et maintenez la base de données.\n\nDéveloppeurs Back-End: c'est un peu similaire aux ingénieurs de données en matière de gestion de base de données. Il est difficile de trouver une application backend sans base de données.\n\nDéveloppeurs Frontend: ils ne vont pas écrire beaucoup de SQL, mais avec la montée en puissance de Angular.js, React.js et d’autres frameworks d’application à page unique, il est probable que vous allez interagir plus souvent directement avec les bases de données. Il suffit donc d’apprendre le langage SQL et il sera très utile si vous devenez un jour un développeur à pile complète.\n\nDéveloppeurs d'applications mobiles: si vous êtes un développeur d'applications mobiles, en particulier pour Android, vous avez déjà entendu parler de SQLite. SQLite est une base de données intégrée largement utilisée depuis plus de 20 ans par la majorité des développeurs Android pour les projets où ils ont besoin de stocker les données sur un périphérique, pas sur un serveur. Bien sûr, il est alimenté par SQL.\n\nMarketing / Finance / RH : en tant que business, vous devez être axé sur les données. Connaître SQL vous permettra de d'obtenir les données dont vous avez besoin et vous permettra de mieux analyser votre entreprise. Cela vous donnera plus de perspicacité et vous aidera à avoir plus de valeur.\n\nUne autre bonne nouvelle est que vous n’avez pas besoin de connaître la programmation ni d’être technique pour apprendre le langage SQL.\n\nPourquoi ce cours pour apprendre SQL ?\n----------------------------------------------------------------\nCe cours vous apprendra les bases du SQL - le langage le plus utilisé pour la communication avec des bases de données. Nous allons travailler avec des exemples CONCRET utilisant une base de données MySQL - mais les connaissances s’appliquent à d’autres types de SGBD (postgreSQL, HiveSQL, Oracle, SQL Server...).","commandRuns":[{"startIndex":53,"length":35,"onTap":{"innertubeCommand":{"clickTrackingParams":"CKMEEM2rARgBIhMI_bnn7q cs sur \"J'aime\""}},{"viewCountFactoidRenderer":{"viewCountEntityKey":"EgtwS3VPQXFLcEdkdyDCASgB","factoid":{"factoidRenderer":{"value":{"simpleText":"460 345"},"label":{"simpleText":"vues"},"accessibilityText":"460 345 vues"}},"viewCountType":"VIEW_COUNT_FACTOID_TYPE_TOTAL_VIEWS"}},{"factoidRenderer":{"value":{"simpleText":"2019"},"label":{"simpleText":"3 mai"},"accessibilityText":"3 mai 2019"}}],"channelNavigationEndpoint":{"clickTrackingParams":"CBoQ040EGAciEwj9uefuroqNAxWE40kHHfbzDxc=","commandMetadata":{"webCommandMetadata":{"url":"/@ZackISMAILI","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCQFm9OrikP4EhU84bkTOEyQ","canonicalBaseUrl":"/@ZackISMAILI"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/8Ks1o2LimdnAurP5-zJ69FQEXjE6nXAcz1h_5PFiafR1Fou79NETYjE54i6ooSraPKi0cpapRA=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Plus"}},"simpleText":"...afficher plus"},"showLessText":{"simpleText":"Moins"},"attributedDescriptionBodyText":{"content":"💌 REÇOIS MES EMAILS PRIVÉS POUR PROGRESSER EN SQL : https://go.brightcape.co/newsletter\n\n\nL'objectif de cette vidéo :\n---------------------------\nDans cette vidéo est de vous présenter le programme de cette formation SQL\n\n🔴 COMMENT ME SUIVRE :\n➡️ Abonne-toi à la chaîne YouTube\n➡️ Retrouve-moi sur INSTAGRAM :   / data_analyst.fr  \n\nQu'est ce que SQL ?\n-------------------------------\nSQL (Structured Query Language) est le langage principal utilisé dans la gestion des données stockées dans un système de gestion de base de données relationnelle (SGBDR) ou du traitement de flux dans un système de gestion de flux de données relationnelles (RDSMS).\n\nEn d'autres termes, SQL est LE LANGAGE utilisé pour interagir avec une base de données.\n\nPourquoi est-il important d’apprendre le SQL?\n-------------------------------------------------------------------------\nSQL est le langage de base de données le plus universel et le plus utilisé : Nous vivons à une époque où les données constituent l’atout le plus précieux et sont au cœur de chaque processus de prise de décision. SQL est l'interface universelle pour l'analyse de données.\n\nSi vous voulez accéder à des bases de données, alors oui, vous devez connaître le langage SQL.\n\nIl n’est pas très difficile d’apprendre le SQL: SQL n’est pas un langage de programmation, c’est un langage de requête. L’objectif principal de la création de SQL était de donner la possibilité aux gens ordinaires d’obtenir des données de la base de données. Il s’agit également d’un langage dont la syntaxe est extrêmement simple . Toute personne peut facilement écrire une requête SQL.\n\n SQL est l’une des compétences les plus recherchées par les employeurs : Toutes les entreprises, quel que soit leur secteur d’activité, reposent toutes sur des données et doivent organiser et comprendre les informations de manière pertinente. \n\nQui devrait apprendre le langage SQL et dans quel but ?\n-----------------------------------------------------------------------------------------\nBusiness Analysts / Product Owners: les Product owners doivent toujours connaître parfaitement le produit qu’ils possèdent, et les données disent la vérité sur la santé d’un produit. C’est bien de connaître SQL et de contrôler ce qui se passe.\n\nAnalystes de données (Data Analysts): le mot ‘données’ figure déjà dans le titre, de même que la popularité des bases de données relationnelles, sachant que SQL est indispensable.\n\nData Scientists: Ceux qui comprennent toujours les données mieux que quiconque sur Terre. Ils doivent absolument maîtriser SQL.\n\nIngénieurs de données (Data Engineer): comme pour les Data Scientist et les Data Analyst, il est indispensable de connaître le langage SQL lorsque vous concevez et maintenez la base de données.\n\nDéveloppeurs Back-End: c'est un peu similaire aux ingénieurs de données en matière de gestion de base de données. Il est difficile de trouver une application backend sans base de données.\n\nDéveloppeurs Frontend: ils ne vont pas écrire beaucoup de SQL, mais avec la montée en puissance de Angular.js, React.js et d’autres frameworks d’application à page unique, il est probable que vous allez interagir plus souvent directement avec les bases de données. Il suffit donc d’apprendre le langage SQL et il sera très utile si vous devenez un jour un développeur à pile complète.\n\nDéveloppeurs d'applications mobiles: si vous êtes un développeur d'applications mobiles, en particulier pour Android, vous avez déjà entendu parler de SQLite. SQLite est une base de données intégrée largement utilisée depuis plus de 20 ans par la majorité des développeurs Android pour les projets où ils ont besoin de stocker les données sur un périphérique, pas sur un serveur. Bien sûr, il est alimenté par SQL.\n\nMarketing / Finance / RH : en tant que business, vous devez être axé sur les données. Connaître SQL vous permettra de d'obtenir les données dont vous avez besoin et vous permettra de mieux analyser votre entreprise. Cela vous donnera plus de perspicacité et vous aidera à avoir plus de valeur.\n\nUne autre bonne nouvelle est que vous n’avez pas besoin de connaître la programmation ni d’être technique pour apprendre le langage SQL.\n\nPourquoi ce cours pour apprendre SQL ?\n----------------------------------------------------------------\nCe cours vous apprendra les bases du SQL - le langage le plus utilisé pour la communication avec des bases de données. Nous allons travailler avec des exemples CONCRET utilisant une base de données MySQL - mais les connaissances s’appliquent à d’autres types de SGBD (postgreSQL, HiveSQL, Oracle, SQL Server...).","commandRuns":[{"startIndex":53,"length":35,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBoQ040EGAciEwj9uefuroqNAxWE40kHHfbzDxdI3LOklarA49WkAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.y
